"use strict";(self.webpackChunkspanish_prototype=self.webpackChunkspanish_prototype||[]).push([[2318],{2318:e=>{e.exports=JSON.parse('{"lessonId":"A1_U45","title":"\u0423\u0440\u043e\u043a 45: Presente de indicativo \u0433\u043b\u0430\u0433\u043e\u043b\u0430 TENER","level":"A1","components":[{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u0421\u043f\u0440\u044f\u0436\u0435\u043d\u0438\u0435 \u0433\u043b\u0430\u0433\u043e\u043b\u0430 TENER \u0432 \u043d\u0430\u0441\u0442\u043e\u044f\u0449\u0435\u043c \u0432\u0440\u0435\u043c\u0435\u043d\u0438","content":[{"table":{"headers":[],"rows":[["(yo) <strong>tengo</strong>","(nosotros, -as) <strong>tenemos</strong>"],["(t\xfa) <strong>tienes</strong>","(vosotros, -as) <strong>ten\xe9is</strong>"],["(usted) <strong>tiene</strong>","(ustedes) <strong>tienen</strong>"],["(\xe9l, ella) <strong>tiene</strong>","(ellos, -as) <strong>tienen</strong>"]]}}]},{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u0418\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u0435 TENER","content":[{"text":"<strong>`Tener` \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f \u0434\u043b\u044f:</strong>"},{"list":["<strong>- \u0443\u043a\u0430\u0437\u0430\u043d\u0438\u044f \u043d\u0430 \u0432\u043b\u0430\u0434\u0435\u043d\u0438\u0435.</strong><br><i>\xbf<strong>Tienes</strong> dinero? / <strong>Tengo</strong> un ordenador nuevo. / Luis no <strong>tiene</strong> coche.</i>","<strong>- \u0437\u0430\u043f\u0440\u043e\u0441\u0430 \u0447\u0435\u0433\u043e-\u043b\u0438\u0431\u043e (\u0432 \u0432\u043e\u043f\u0440\u043e\u0441\u0430\u0445).</strong><br><i>\u2013\xbf<strong>Tienes</strong> un l\xe1piz? \u2013S\xed, pero lo necesito.</i>","<strong>- \u0440\u0430\u0437\u0433\u043e\u0432\u043e\u0440\u0430 \u043e \u0441\u0435\u043c\u044c\u0435.</strong><br><i>Cristina <strong>tiene</strong> siete hermanos.<br>\xbfCu\xe1ntos hijos <strong>ten\xe9is</strong>? \u2013No <strong>tenemos</strong> hijos.</i>","<strong>- \u0443\u043a\u0430\u0437\u0430\u043d\u0438\u044f \u0432\u043e\u0437\u0440\u0430\u0441\u0442\u0430.</strong><br><i>\xbfCu\xe1ntos a\xf1os <strong>tienes</strong>? / Mis abuelos <strong>tienen</strong> noventa a\xf1os.</i>","<strong>- \u043e\u043f\u0438\u0441\u0430\u043d\u0438\u044f \u043b\u044e\u0434\u0435\u0439, \u0432\u0435\u0449\u0435\u0439 \u0438\u043b\u0438 \u043c\u0435\u0441\u0442.</strong><br><i>Enrique <strong>tiene</strong> los ojos verdes. / Mi casa no <strong>tiene</strong> jard\xedn.</i>","<strong>- \u0432\u044b\u0440\u0430\u0436\u0435\u043d\u0438\u044f \u043d\u0435\u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u0444\u0438\u0437\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0438 \u044d\u043c\u043e\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0445 \u0441\u043e\u0441\u0442\u043e\u044f\u043d\u0438\u0439.</strong><br><i>hambre, sed, fr\xedo, calor, miedo, sue\xf1o, fiebre, gripe...<br><strong>Tienes</strong> mala cara. / \xbf<strong>Tienes</strong> fiebre?</i>"]}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 45.1: \u0414\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435 \u0444\u0440\u0430\u0437\u044b \u0441 tengo, tienes, tiene... \u0432 \u0443\u0442\u0432\u0435\u0440\u0434\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0439 \u0438\u043b\u0438 \u043e\u0442\u0440\u0438\u0446\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0439 \u0444\u043e\u0440\u043c\u0435","tasks":[{"id":"u45_1_1","sentence":"1. PEPA: Jorge ___ treinta y un a\xf1os, Julio y Margarita ___ veintitr\xe9s y yo ___ veintiocho.","answer":"tiene, tienen, tengo"},{"id":"u45_1_2","sentence":"2. JORGE: Margarita ___ dos hermanos, Pepa ___ una hermana y Julio y yo ___ dos hermanos.","answer":"tiene, tiene, tenemos"},{"id":"u45_1_3","sentence":"3. MARGARITA: Pepa y Jorge ___ tres hijos, pero Julio y yo ___ hijos.","answer":"tienen, no tenemos"},{"id":"u45_1_4","sentence":"4. PEPA: Yo ___ los ojos marrones. Los ___ verdes.","answer":"tengo, tengo"},{"id":"u45_1_5","sentence":"5. JULIO: Jorge ___ los ojos negros y Margarita y yo los ___ marrones.","answer":"tiene, tenemos"}]},{"type":"TheoryBlock","title":"\u041f\u0440\u0438\u043c\u0435\u0447\u0430\u043d\u0438\u0435: \u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u044f 45.2 \u0438 45.3","content":[{"text":"<strong>\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u044f 45.2 \u0438 45.3 \u043f\u0440\u043e\u043f\u0443\u0449\u0435\u043d\u044b, \u0442\u0430\u043a \u043a\u0430\u043a \u043e\u043d\u0438 \u043f\u043e\u043b\u043d\u043e\u0441\u0442\u044c\u044e \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u044b \u043d\u0430 \u0430\u043d\u0430\u043b\u0438\u0437\u0435 \u0438\u0437\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u0438\u0439.</strong>"}]}]}')}}]);